import './App.css';
import { useState } from 'react';

function App() {
  const [count, setCount] = useState(0);

  return (
    <div className="App">
      <h1>Counter: {count}</h1>
      <button onClick={() => setCount(count + 5)} className="button"> Add </button>
      <button onClick={() => setCount(count - 1)} className="button"> Sub </button>
    </div>
  );
}

export default App;
